import React from 'react';
import logo from './logo.svg';
import './App.css';

class App extends React.Component {
  constructor(props) {
    super(props);
    this.handleOnChange = this.handleOnChange.bind(this);
    this.state = { ip: "10.10.10.10" };
  }

  handleOnChange(event) {
    this.setState = event.target.value;
  }

  render() {
    return (
      <div className="App">
        <header className="App-header">
          <div>IP Address:</div><input value="10.10.10.10" onChange={this.handleOnChange} />
          <div style={{fontSize:14}}>Searching {this.state.ip} ...</div>
        </header>
        <article className="App-article">
          <div>Hello {this.props.para1}</div>
        </article>
        <footer className="App-footer">
          <div>Script by Mongkol Thamwongskul. Powered by React.</div>
        </footer>
      </div>
    )
  };
}

export default App;
